import sys
from arcpy import env

def main():
    if len(sys.argv) != 4:
        print("Usage: data_prep.py <in_gdbs_base_folder> <out_gdb> <out_feature_dataset>")
        # sys.exit(1)

    in_gdbs_base_folder = sys.argv[1]
    out_gdb = sys.argv[2]
    out_feature_dataset = sys.argv[3]

    arcpy.env.overwriteOutput = True
    import os
    # Create output geodatabase
    arcpy.CreateFileGDB_management(os.path.dirname(out_gdb), os.path.basename(out_gdb))

    # Create feature dataset
    arcpy.CreateFeatureDataset_management(out_gdb, out_feature_dataset)

    # Set the output workspace to the feature dataset
    arcpy.env.workspace = os.path.join(out_gdb, out_feature_dataset)

    # Loop through input geodatabases
    for gdb in arcpy.ListWorkspaces(workspace_type="FileGDB", location=in_gdbs_base_folder):
        # Transfer feature classes to the output feature dataset
        for fc in arcpy.ListFeatureClasses(feature_dataset=os.path.basename(gdb)):
            arcpy.FeatureClassToFeatureClass_conversion(os.path.join(gdb, fc), out_feature_dataset, fc)

    # Get spatial reference from one of the input feature classes and apply it to the output feature dataset
    input_fc = os.path.join(gdb, fc)
    desc = arcpy.Describe(input_fc)
    sr = desc.spatialReference
    arcpy.DefineProjection_management(out_feature_dataset, sr)

if __name__ == "__main__":
    main()


